@subehi achmad kisah taubatnya penyanyi bernama zaadzan setelah ditegur Sahabat Nabi. Zaadzan berkata, “Saya adalah seorang pemuda yang bersuara merdu dan pandai memukul gendang. Ketika saya bersama teman-teman sedang meminum minuman keras, lewatlah Ibnu Mas’ud. Maka dia pun memasuki (tempat kami), kemudian dia memukul tempat (yang berisikan minuman keras) dan membuangnya. Dia juga memecahkan gendang kami. Lalu dia berkata, ‘Kalaulah yang terdengar dari suaramu yang bagus adalah Al-Qur’an, maka Engkau adalah Engkau … Engkau.’ Setelah itu Ibnu Mas’ud pun pergi.

Aku pun bertanya kepada temanku, ’Siapa orang itu?’ Mereka berkata, ’Dia adalah Abdullah bin Mas’ud, sahabat Nabi shallallahu ‘alaihi wa sallam. Maka dengan kejadian itu, (dimasukkan) ke dalam jiwaku perasaan taubat. Setelah itu aku berusaha mengejar Abdullah bin Mas’ud sambil menangis. Setelah mendapatinya, aku tarik baju Abdullah bin Mas’ud. Maka Ibnu Mas’ud pun menghadap ke arahku dan memelukku sambil menangis. Dia berkata, ‘Marhaban (selamat datang) orang yang dicintai Allah. Duduklah!’ Lalu Ibnu Mas’ud pun masuk dan menghidangkan kurma untukku.’



